352,536870951]],[logseq____&quot;^15logseq____&quot;,[1291,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u670c837c-2666-41a2-9c2c-04cee3edf72alogseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1292,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Aptly regarded as a man of many sounds by Billboard, Yotto’s ‘Erased Dreams’ also marks Reflections’ debut LP release; an 8 track ambient journey, revealing a new side to one of Anjuna’s most illustrious producers. Well-known for his thunderous DJ sets and deep, bass-heavy house productions, ‘Erased Dreams’ may seem like a departure from Yotto’s usual style, but he’s always made music like this. With Reflections, he finally found a home for it.logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1292,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1292,logseq____&quot;^Flogseq____&quot;,1291,536870951]],[logseq____&quot;^15logseq____&quot;,[1292,logseq____&quot;^Xlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1292,logseq____&quot;^Vlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1292,logseq____&quot;^Ulogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1292,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u670c837c-7503-49fc-a30a-165e41b32cbclogseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Flogseq____&quot;,1292,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Xlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Vlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Ulogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Ulogseq____&quot;,1290,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^Hlogseq____&quot;,1290,536870951]],[logseq____&quot;^15logseq____&quot;,[1293,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u670c837c-3edc-4074-88e7-84c9959d2e25logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1294,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. ’It’s slow and steady and it grows. I think the beauty lies in the simplicity of it.”logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1294,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1294,logseq____&quot;^Flogseq____&quot;,1293,536870951]],[logseq____&quot;^15logseq____&quot;,[1294,logseq____&quot;^Xlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1294,logseq____&quot;^Vlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1294,logseq____&quot;^Ulogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1294,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u670c837c-dd23-4760-bd90-0dcd63dae516logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1295,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Club music will always be at the core of Yotto’s work, but his ambient catalogue will no longer sit in the shadows. Together, these parallel forms of expression don’t dilute Yotto’s artistry; they make it even stronger.logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1295,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1295,logseq____&quot;^Flogseq____&quot;,1294,536870951]],[logseq____&quot;^15logseq____&quot;,[1295,logseq____&quot;^Xlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1295,logseq____&quot;^Vlogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1295,logseq____&quot;^Ulogseq____&quot;,352,536870951]],[logseq____&quot;^15logseq____&quot;,[1295,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u670c837c-01a5-4fee-a24e-1c0ed50d8561logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1296,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1296,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1296,logs       // This script checks to see if a redirect is present in the query string
